import React from 'react'
import SearchBox from './SearchBox'

class Header extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return (
      <div className="header-wrapper light-border-bottom drop-shadow">
        <div className="constrained-width">
          <img className="logo logo-sm" src="/images/logo.png" />
          <SearchBox />
          <div className="leaderboard-menu-link">
            <i className="material-icons">emoji_events_rounded</i>
            <p>Leaderboard</p>
          </div>
        </div>
      </div>
    )
  }
}

export default Header
